import React,{useState} from "react";

import {
  TextField,
  Grid,
  Paper,
  Avatar,
  Button,
  FormControlLabel,
  Checkbox,
  Typography,
} from "@mui/material";
import LockIcon from "@mui/icons-material/Lock";
import { Link } from "react-router-dom";

export function Login() {
  let [email, setEmail] = useState("")
  let [password ,setPassword] = useState("")
  const paperStyle = {
    padding: 20,
    height: "70vh",
    align: "center",
    width: 300,
    margin: "20px auto",
  };

  const handelSubmit =(e) =>{
    e.preventDefault();
  console.log(email ,password)
  }


  const avatarStyle = { backgroundColor: "#1bbd7e" };
  return (
    <div>
      <div>
        <Grid>
          <Paper elevation={10} style={paperStyle}>
            <Grid align="center">
              <Avatar style={avatarStyle}>
                <LockIcon />
              </Avatar>
            </Grid>
            <br />
            <h1 style={{"text-align": "center" }}>LogIn</h1>
            <div style={{ padding: "30px" }}>
              <br />
              <TextField variant="outlined" label="Email" type="email" value={email} onChange={(e)=>{setEmail(e.target.value)}} />
              <br />
              <br />
              <TextField variant="filled" label="Password" type="password" value={password} onChange={(e)=>{setPassword(e.target.value)}}/>
            </div>
            <FormControlLabel
              control={<Checkbox name="checkedB" color="primary" />}
              label="Remember me"
            />
            <Button type="submit" color="primary" variant="contained" fullWidth onClick={handelSubmit}>
              Sign in
            </Button>
            <br />
            <Typography>
              <Link href="#">Forget password ?</Link>
            </Typography>
            <br />
            <Typography>
              <Link href="#">Sign Up</Link>
            </Typography>
          </Paper>
        </Grid>
      </div>
    </div>
  );
}
